import React, { Component } from 'react';
import './Header.css';
import  Buttons from'./Buttons';
import  Title from'./Title';


class Header extends Component {
    render() {
        return (
            <header>

             <Title></Title>
             <Buttons></Buttons>
             
             </header>
 
        )
    }
}
export default Header;
